import React from 'react';

const addClass = (WrappedComponent: any, className: string) => {
    // const hasClicked = () => {
    //     console.log('print!');
    // };
    return (props:any) => (
        <div className={className}>
            <WrappedComponent {...props}>{props.children}</WrappedComponent>
        </div>
    );
};

export default addClass;
